declare const SQL_QUERY = "\nINSERT INTO PersonPhone (\n  \"createdAt\", \"updatedAt\", \"deletedAt\", \"type\", \"personId\", \"phoneId\"\n) VALUES (\n  @createdAt, @updatedAt, @deletedAt, @type, @personId, @phoneId\n)\nON CONFLICT (\"personId\", \"phoneId\") DO UPDATE SET\n\"createdAt\" = MIN(@createdAt, \"createdAt\"), \"updatedAt\" = MAX(@updatedAt, \"updatedAt\"), \"deletedAt\" = IFNULL(@deletedAt, \"deletedAt\"), \"type\" = IFNULL(@type, \"type\")\n";
export default SQL_QUERY;
